import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Course } from '../model/course';
import { Course1 } from '../model/course1';
import { CourseService } from '../course.service';

@Component({
  selector: 'app-admincourses',
  templateUrl: './admincourses.component.html',
  styleUrls: ['./admincourses.component.css']
})
export class AdmincoursesComponent {

  course: Course1[] = [];
  selectedProduct: Course1 | undefined;

  // constructor(private service: ProductService) {}
  constructor(private service:CourseServiceService,private router: Router){}

  ngOnInit(): void {
    this.getProducts();
  }

  getProducts(): void {
    this.service.getProducts().subscribe((Products) => {
      this.Products = Products;
    });
  }
}
